77.body:
Subscribe to a transaction signature to receive notification when the transaction is confirmed On signatureNotification , the subscription is automatically cancelled Parameters: string - Transaction Signature, as base-58 encoded string Results: integer - subscription id (needed to unsubscribe) Example: // Request
{"jsonrpc":"2.0", "id":1, "method":"signatureSubscribe", "params":["2EBVM6cB8vAAD93Ktr6Vd8p67XPbQzCJX47MpReuiCXJAtcjaxpvWpcg9Ege1Nr5Tk3a2GFrByT7WPBjdsTycY9b"]} // Result
{"jsonrpc": "2.0","result": 0,"id": 1} Notification Format: {"jsonrpc": "2.0","method": "signatureNotification", "params": {"result": "Confirmed","subscription":0}}

